import { Grid } from "@material-ui/core";

export default function Products({ products }) {
  return products?.length
    ? products.map((product) => (
        <Grid container spacing={1}>
          <Grid item xs={4}>
            <img
              src={
                product.image
                  ? product.image.publicUrl
                  : product.images[0].file.publicUrl
              }
            />
          </Grid>
          <Grid item xs={8}></Grid>
        </Grid>
      ))
    : "...";
}
